import React, { useContext } from "react";
import { Container, Navbar as NavbarComp, NavDropdown, Nav } from "react-bootstrap";
import { Link, useHistory } from "react-router-dom";
import { userContext } from "../context/userContext";
import booksLogo from "../assets/books-logo.png";

function NavbarAdmin(props) {
  const [dispatch] = useContext(userContext);



  const logout = () => {
    dispatch({
      type: "LOGOUT",
    });
    history.push("/auth");
  };

  return (
    <NavbarComp expand="lg">
      <Container>
        <NavbarComp.Brand as={Link} to="/complain-admin">
          <img
            src={booksLogo}
            className="img-fluid rounded rounded-5"
            style={{ width: "60px", height: "60px" }}
            alt="brand"
          />
        </NavbarComp.Brand>
        <NavbarComp.Toggle aria-controls="basic-navbar-nav" />
        <NavbarComp.Collapse id="basic-navbar-nav">
          <Nav className="ms-auto rounded rounded-5">
            <Nav.Link
              as={Link}
              to="/complain-admin"
              className={
                props?.title == "Complain admin"
                  ? `text-navbar-active`
                  : `text-navbar`
              }
            >
              Complain
            </Nav.Link>
            <Nav.Link
              as={Link}
              to="/category-admin"
              className={
                props?.title == "Category admin"
                  ? `text-navbar-active`
                  : `text-navbar`
              }
            >
              Category
            </Nav.Link>
            <Nav.Link
              as={Link}
              to="/product-admin"
              className={
                props?.title == "Product admin"
                  ? `text-navbar-active`
                  : `text-navbar`
              }
            >
              Product
            </Nav.Link>
            <Nav.Link onClick={logout} className="text-navbar">
              Logout
            </Nav.Link>
          </Nav>
        </NavbarComp.Collapse>
      </Container>
    </NavbarComp>
  );
}

export default NavbarAdmin;
